import React from "react";
import {ListItem, ListItemText} from "@material-ui/core";

function TodoListItem({todo, progress, id}){
        return(
            <div>
                <ListItem>
                    <ListItemText></ListItemText>
                </ListItem>
                <p>{todo}</p>
            </div>
        )
}

export default TodoListItem;
